description:
Verenigde Staten
Komedie
114 minuten

een goeie film

met Martin Lawrence, James Earl Jones en Joy Bryant

Dr. RJ Stevens, een talkshow-host, ontloopt zijn vroeger armzalige bestaan door te verkondigen dat alles kan in het leven. Met 
veel succes en geld op zak, heeft hij het gevoel dat hij alles heeft bereikt wat er te bereiken valt. Wanneer hij wordt 
uitgenodigd voor het 50-jarige huwelijk van zijn ouders, gaat hij ernaar toe, klaar om zijn ouders te imponeren met de successen 
die hij heeft behaald en hoe hij is veranderd. Tenminste... dat is het plan.
-
